(42, 'ITZR', 'http://en.itzr.cn/', '42.jpg', '<p>Operating for over 13 years and certified to ISO9001, Shenzhen ITZR Technology Co., Ltd., is a specialist in theresearch, production and sale of a wide variety of motherboards for laptops, desktop, industrial, and all-in-one PCs as well as mobiles and tablets. We also have significant experience in OEM assembly of 10, 13, and 14laptops for many customers worldwide.<br />\n</p>\n\n<p>We are by reputation, one of the leading manufacturers of motherboards and laptops in China. We invest heavily in the latest equipment as well as training for our workforce whether assembly or management. We have large scale production capacity and utilising the latest production planning techniques can ensure that we meet with your needs.<br />\n</p>\n\n<p>Because of our excellent design, high build quality and competitive prices, we are rapidly expanding our sales in Europe, America, Southeast Asia and the Middle East. We will work hard to help you meet your objectives and look forward to making new friends worldwide..</p>\n');
